import React, { Component } from 'react';



class LogFilter extends Component {
    render() {
        return (
            <div className="container" style={{
                paddingTop: "60px"
              }}>
                <h5 style={{
                    paddingLeft:"10px",
                    borderLeft: "5px solid #555555"
                }}>Error Log Filter</h5>

                <select options={"Flow"}></select>
            </div>
        )
    }
}

export default LogFilter;
